engine-implementation.html.body:
Engine Implementation
In the following example, "SrcEngine", "DestEgnine", and "FrameworkerEngine" are the engines that are used to connect data in the ResNet-18 network.

SrcEngine: Reads and sends BGR binary files.
FrameworkerEngine: Invokes the ResNet-18 network model for computing and outputs the result to DestEngine.
DestEngine: Saves the generated result file.

Figure 1  shows an example of code running.
Figure  1  Code running example

 NOTE:This section describes the code implementation. You do not need to modify the code implementation when running the sample project.  

The process function for engine implementation encapsulates the functionalities that need to be implemented.
Data flows between engines in the following ways:
std::shared_ptr input_arg = std::static_pointer_cast(arg0);
// This function can be used to obtain the data flows transferred by Graph::Send.
hiai::Engine::SendData(0, "Typename", std::static_pointer_cast(input_arg));
// This function can be used to send data flows to the port of the target engine.
For details about the APIs, see the  HiAI Engine API Reference.
SrcEngine/DestEngine

Code of the SrcEngine implementation sample: Custom_Engine/impl/src_engines.cpp
