{
   // Read the file.
    std::shared_ptr input_arg =
        std::static_pointer_cast(arg0);

    if (nullptr == input_arg) 
    {
        HIAI_ENGINE_LOG(this, HIAI_INVALID_INPUT_MSG, "fail to process invalid message");
        return HIAI_INVALID_INPUT_MSG;
    }

   // Transmit data transparently and output it to port 0.
    hiai::Engine::SendData(0, "string", std::static_pointer_cast(input_arg));

    return HIAI_OK;
}

