multi-port-message-receiving.html.body:
Multi-Port Message Receiving
This test case does not involve the multi-port input/output handling process. You can also refer to the sample code to view how to register a user-defined data type. During the actual use of HiAI Engine, the output port of an engine may send its result to the input ports of multiple engines, or the input port of an engine receives the information sent from the output ports of multiple engines. You can handle multiple ports of an engine as required.
The following example describes how to manage the input messages of multiple ports by using the private member variable  input_que_.

Push data.
input_que_.PushData(0,arg0);
input_que_.PushData(1,arg1);
input_que_.PushData(2,arg2);

Pop data.
std::shared_ptr input_arg1;
std::shared_ptr input_arg2;
std::shared_ptr> input_arg3;

Perform post-processing.
Perform this step only when all three ports have input data.
if (!input_que_.PopAllData(input_arg1, input_arg2, input_arg3))
{
    HIAI_ENGINE_LOG(this, HIAI_INVALID_INPUT_MSG, "fail to process");
    return HIAI_INVALID_INPUT_MSG;
}

