    }

   // Line in the 2D or 3D space
    template   // T: Point2D  Point3D
    struct Line {
        T start;
        T end;
    };

    template
    void serialize(Archive& ar, Line& data) {
        ar(data.start, data.end);
    }

  // Rectangular plane in 2D or 3D space
