    }

    ///////////////////////////////////////////////////////
    /////////////// 3. region image tensor ////////////////
    ///////////////////////////////////////////////////////

    template
    struct RegionImage {
        std::vector > region;
        std::vector v_obj_id;
    };

    template
    void serialize(Archive& ar, RegionImage& data) {
