   // Recursion ID tree node
    struct IDTreeNode {
       std::vector  nodeID;     // Node ID
       std::vector is_leaf;         // Whether it is a leaf node
       std::vector node;     // Pointer to the subnode structure
    };

    template 
    void serialize(Archive& ar, IDTreeNode& data) {
        ar(data.nodeID, data.is_leaf, data.node);
    }

   // Parameter
    struct IDTreePara {
        FrameInfo f_info;    // Frame information
