Other External APIs
This section describes the APIs provided by HiAI Engine for other components. You are advised not to call them directly.
Profiling APIs are provided for other components. These APIs are defined in profile.h.
1.1 Obtaining instances
static ProfileStatistic* ProfileStatistic::GetInstance();
1.2 Registering data types
void ProfileStatistic::RegisterType(const uint32_t& typeID, const std::string& profileTypeDes);
1.3 Recording start time
void ProfileStatistic::RecordStartTime(const uint32_t& profileType);
1.4 Recording end time
void ProfileStatistic::RecordEndTime(const uint32_t& profileType,const uint64_t& reqID = 0);
1.5 Returning graph statistics
std::string ProfileStatistic::ProfileStatisticString(const uint32_t& graphId);
1.6 Returning engine statistics
std::string ProfileStatistic::ProfileSingleEngine(const std::vector& profileInfoVec);
1.7 Recording the start time of a graph
void ProfileStatistic::RecordGraphStartTime(const uint32_t& graphId);
1.8 Recording the end time of a graph
void ProfileStatistic::RecordGraphEndTime(const uint32_t& graphId);
1.9 Adding engine IDs
void ProfileStatistic::AddEngineID(const uint32_t& threadID, const std::string& engineName, const uint32_t& graphId);
1.10 Determining whether to write statistics data
bool ProfileStatistic::NeedWrite();
1.11 Setting the recording switch for the performance data
static void ProfileStatistic::SetProfileSwitch(bool switchForProfile);
1.12 Checking whether the profiling function is available
static bool& ProfileStatistic::IsProfileEnable();
1.13 Stopping waiting for performance statistics
void ProfileStatistic::StopWait();
1.14 Obtaining the current time
uint64_t ProfileStatistic::ProfileGetCurrentTime();
1.15 Obtaining a mutex
static std::mutex& ProfileStatistic::GetMutex();
1.16 Obtaining an update mutex
static std::mutex& ProfileStatistic::GetUpdateMutex();

1.17 Recording the profiling start time
PROFILESTATIC_STARTTIME(profileType)
1.18 Recording the profiling end time
PROFILESTATIC_ENDTIME(profileType)
1.19 Recording the end time of engine profiling
PROFILESTATIC_ENGINE_ENDTIME(profileType, reqID)
1.20 Adding the engines that need to be profiled
PROFILESTATIC_ADDENGINE(threadID, engineName, graphId)
1.21 Adding the data types that need to be profiled
PROFILESTATIC_REGTYPE(profileID, profileType, profileDes)
1.22 Recording the start time of a graph
PROFILESTATIC_GRAPH_STARTTIME(graphId)
1.23 Recording the end time of a graph
PROFILESTATIC_GRAPH_ENDTIME(graphId)
1.23 Automatically registering profile data types
ProfileTypeRegister::ProfileTypeRegister(const uint32_t& profileType, const std::string& profileDes)

