Example of Orchestration Configuration
The configuration file for creating graphs （graph.prototxt） is in proto format. In the following example, two graphs are created. Each graph has multiple engines with the mapping relationships.

 NOTICE:If you want to transfer a file, the following conditions must be met. Otherwise, the system transfers a character string or digit by default.  

In Linux, the file must contain a relative path or an absolute path, for example,  /home/1.txt  or../test/2.txt.  
In Windows, the file must contain a relative path or an absolute path, for example,  c:\1.txt  or..\test\2.txt.  


graphs {
  graph_id: 100
  device_id: "0"
  priority: 1
  engines {
    id: 1000
    engine_name: "SrcEngine"
    side: HOST
    thread_num: 1
  }
  engines {
    id: 1001
    engine_name: "HelloWorldEngine"
    so_name: "./libhelloworld.so"
    side: DEVICE
    thread_num: 1
  }
  engines {
    id: 1002
    engine_name: "DestEngine"
    side: HOST
    thread_num: 1
  }
  connects {
    src_engine_id: 1000
    src_port_id: 0
